Defendant Pablo A Zielinski in court with attorney Elizabeth A Carlson.  Joy Hammond appeared for the State of Wisconsin.  Deputy Court Clerk ssm.

AS TO BOTH COUNTS:  Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  
AS TO COUNT 1:  Defendant sentenced to serve 9 MONTHS in the House of Correction with credit for 17 days time served; STRAIGHT TIME.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 18 MONTHS consecutive to House of Correction sentence currently being served.

AS TO COUNT 2:  Defendant sentenced to serve 4 MONTHS in the House of Correction CONSECUTIVE to Count 1; STRAIGHT TIME.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 18 MONTHS consecutive to House of Correction sentence currently being served.

CONDITIONS AS TO BOTH COUNTS:  
*  No contacty with Cindy N.;
*  Successfully complete a course in anger management;
*  Successfully complete a Batterer's Intervention Program;
*  AODA assessment/treatment deemed appropriate;
*  Maintain absolute sobriety to be monitored by random urine screens;
*  Pay costs and surcharges or, if not paid, convert to a civil judgment;
*  Pay restitution in the amount of $480.00 to Cindy N.; AS TO COUNT 1 ONLY.

Notice of Right to Seek Postconviction Relief received and filed.
